import "./navbar.css"
import React,{useState} from "react"
function Navbar(){
    const[clicked,setClicked]=useState(false)
    const clickControler =()=>{setClicked(!clicked);console.log(clicked)}
    const tipeControler=()=>{
        if (clicked){
            return "fas fa-time"
        }else{return "fas fa-bars"}
    }

    return(
        <div>
            <nav>
                <a href="#" className="logo"><p>MindeloCine</p></a>
                <div>
                    <ul className="navbar-controler">
                        <li><a href="#">Home</a></li>
                        <li><a href="#">About</a></li>
                        <li><a href="#">Contact</a></li>
                        <li><a href="#">Cadastro</a></li>
                    </ul>
                </div>
                <div id="mobile">
                    <i id="bar" className={clicked ? "fas fa-time":"fas fa-bars"} onClick={clickControler}></i>
                </div>
            </nav>
        </div>
    )
}
export default Navbar
